import React from "react";
import { Link } from "react-router-dom";

export default function Contact() {
  return (
    <div className="contact">
      <h2>About Me</h2>
      <p>Name: Your Name</p>
      <p>Email: your.email@example.com</p>
      <p>Phone: (+49) 151 4284-3424</p>
      <h2>How to Contact Me</h2>
    </div>
  );
}
